import { UPDATE_PREVIOUS_RESPONSE } from "../actions/index";

export default function (state = null, action) {
	switch (action.type) {
		case UPDATE_PREVIOUS_RESPONSE:
			return { ...action.payload };
		default:
			return { ...state };
	}
}
